import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import styled from "styled-components";
import AOS from "aos";
import { useEffect } from "react";
import { useTheme } from "@mui/material/styles"; // Import to use the theme inside the component
import { Height } from "@mui/icons-material";
import { Box } from "@mui/material";


// Styling the Navbar text
const NavbarText = styled(Typography)`
  color :white  ;
  font-family: "poppins";
`
const TopBar =styled(Box)`
background-color: black;
text-align: center ;

  
`

export default function Navbar() {
  const theme = useTheme(); // Using the theme inside the component

  useEffect(() => {
    AOS.init({
      duration: 2000,
    });
  }, []);

  return (
    <TopBar>
      <Toolbar>
        <NavbarText data-aos="fade-up">
          Summer Sale: All Swim Suits And Free Express Delivery - OFF 50%! Shop Now
        </NavbarText>
      </Toolbar>
    </TopBar>
  );
}
